    queryPlanText:
     - "LogicalSort(sort0=[$0], sort1=[$1], sort2=[$2], dir0=[ASC], dir1=[ASC], dir2=[ASC])"
     - "  LogicalAggregate(group=[{0, 1, 2}], revenue=[SUM($3)])"
     - "    LogicalProject(supp_nation=[$41], cust_nation=[$45], l_year=[EXTRACT(FLAG(YEAR), $17)], volume=[*($12, -(1, $13))])"
     - "      LogicalFilter(condition=[AND(=($0, $9), =($23, $7), =($32, $24), =($3, $40), =($35, $44), OR(AND(=($41, 'EGYPT'), =($45, 'UNITED STATES')), AND(=($41, 'UNITED STATES'), =($45, 'EGYPT'))), >=($17, 1995-01-01), <=($17, 1996-12-31))])"
     - "        LogicalJoin(condition=[true], joinType=[inner])"
     - "          LogicalJoin(condition=[true], joinType=[inner])"
     - "            LogicalJoin(condition=[true], joinType=[inner])"
     - "              LogicalJoin(condition=[true], joinType=[inner])"
     - "                LogicalJoin(condition=[true], joinType=[inner])"
     - "                  LogicalTableScan(table=[[cp, tpch/supplier.parquet]])"
     - "                  LogicalTableScan(table=[[cp, tpch/lineitem.parquet]])"
     - "                LogicalTableScan(table=[[cp, tpch/orders.parquet]])"
     - "              LogicalTableScan(table=[[cp, tpch/customer.parquet]])"
     - "            LogicalTableScan(table=[[cp, tpch/nation.parquet]])"
     - "          LogicalTableScan(table=[[cp, tpch/nation.parquet]])"
 -
  description: "08.sql"
  input:
   - "-- tpch8 using 1395599672 as a seed to the RNG"
   - "select"
   - "  o_year,"
   - "  sum(case"
   - "    when nation = 'EGYPT' then volume"
   - "    else 0"
   - "  end) / sum(volume) as mkt_share"
   - "from"
   - "  ("
   - "    select"
   - "      extract(year from o.o_orderdate) as o_year,"
   - "      l.l_extendedprice * (1 - l.l_discount) as volume,"
   - "      n2.n_name as nation"
   - "    from"
   - "      cp.\"tpch/part.parquet\" p,"
   - "      cp.\"tpch/supplier.parquet\" s,"
   - "      cp.\"tpch/lineitem.parquet\" l,"
   - "      cp.\"tpch/orders.parquet\" o,"
   - "      cp.\"tpch/customer.parquet\" c,"
   - "      cp.\"tpch/nation.parquet\" n1,"
   - "      cp.\"tpch/nation.parquet\" n2,"
   - "      cp.\"tpch/region.parquet\" r"
   - "    where"
   - "      p.p_partkey = l.l_partkey"
   - "      and s.s_suppkey = l.l_suppkey"
   - "      and l.l_orderkey = o.o_orderkey"
   - "      and o.o_custkey = c.c_custkey"
   - "      and c.c_nationkey = n1.n_nationkey"
   - "      and n1.n_regionkey = r.r_regionkey"
   - "      and r.r_name = 'MIDDLE EAST'"
   - "      and s.s_nationkey = n2.n_nationkey"
   - "      and o.o_orderdate between date '1995-01-01' and date '1996-12-31'"
   - "      and p.p_type = 'PROMO BRUSHED COPPER'"
   - "  ) as all_nations"
   - "group by"
   - "  o_year"
   - "order by"
   - "  o_year "
