    queryPlanText:
     - "LogicalSort(sort0=[$0], dir0=[ASC])"
     - "  LogicalProject(s_name=[$1], s_address=[$2])"
     - "    LogicalFilter(condition=[AND(true, =($3, $7), =($8, 'KENYA'))])"
     - "      LogicalJoin(condition=[=($0, $11)], joinType=[inner])"
     - "        LogicalJoin(condition=[true], joinType=[inner])"
     - "          LogicalTableScan(table=[[cp, tpch/supplier.parquet]])"
     - "          LogicalTableScan(table=[[cp, tpch/nation.parquet]])"
     - "        LogicalAggregate(group=[{0}])"
     - "          LogicalProject(ps_suppkey=[$1])"
     - "            LogicalFilter(condition=[AND(true, >($2, $6))])"
     - "              LogicalCorrelate(correlation=[$cor0], joinType=[left], requiredColumns=[{0, 1}])"
     - "                LogicalJoin(condition=[=($0, $5)], joinType=[inner])"
     - "                  LogicalTableScan(table=[[cp, tpch/partsupp.parquet]])"
     - "                  LogicalAggregate(group=[{0}])"
     - "                    LogicalProject(p_partkey=[$0])"
     - "                      LogicalFilter(condition=[LIKE($1, 'antique%':VARCHAR(8))])"
     - "                        LogicalTableScan(table=[[cp, tpch/part.parquet]])"
     - "                LogicalProject(EXPR$0=[*(0.5:DECIMAL(2, 1), $0)])"
     - "                  LogicalAggregate(group=[{}], agg#0=[SUM($0)])"
     - "                    LogicalProject(L_QUANTITY=[$4])"
     - "                      LogicalFilter(condition=[AND(=($1, $cor0.PS_PARTKEY), =($2, $cor0.PS_SUPPKEY), >=($10, 1993-01-01), <($10, +(1993-01-01, 12:INTERVAL YEAR)))])"
     - "                        LogicalTableScan(table=[[cp, tpch/lineitem.parquet]])"
 -
  description: "21.sql"
  input:
   - "-- tpch21 using 1395599672 as a seed to the RNG"
   - "select"
   - "  s.s_name,"
   - "  count(*) as numwait"
   - "from"
   - "  cp.\"tpch/supplier.parquet\" s,"
   - "  cp.\"tpch/lineitem.parquet\" l1,"
   - "  cp.\"tpch/orders.parquet\" o,"
   - "  cp.\"tpch/nation.parquet\" n"
   - "where"
   - "  s.s_suppkey = l1.l_suppkey"
   - "  and o.o_orderkey = l1.l_orderkey"
   - "  and o.o_orderstatus = 'F'"
   - "  and l1.l_receiptdate > l1.l_commitdate"
   - "  and exists ("
   - "    select"
   - "      *"
   - "    from"
   - "      cp.\"tpch/lineitem.parquet\" l2"
   - "    where"
   - "      l2.l_orderkey = l1.l_orderkey"
   - "      and l2.l_suppkey <> l1.l_suppkey"
   - "  )"
   - "  and not exists ("
   - "    select"
   - "      *"
   - "    from"
   - "      cp.\"tpch/lineitem.parquet\" l3"
   - "    where"
   - "      l3.l_orderkey = l1.l_orderkey"
   - "      and l3.l_suppkey <> l1.l_suppkey"
   - "      and l3.l_receiptdate > l3.l_commitdate"
   - "  )"
   - "  and s.s_nationkey = n.n_nationkey"
   - "  and n.n_name = 'BRAZIL'"
   - "group by"
   - "  s.s_name"
   - "order by"
   - "  numwait desc,"
   - "  s.s_name"
   - "limit 100 "
